const eateriesEndpoint = () => {
  "http://localhost:8080/api/eateries";
};

const getEatery = async (id) => {
  const response = await fetch(`${eateriesEndpoint()}/${id}`);
  await response.json();
};

const getEateries = async () => {
  const response = await fetch(`${eateriesEndpoint()}`);
  await response.json();
};

export { getEateries, getEatery };
